import React from 'react';
import '/home/rguktongole/Desktop/ideanexus/frontend/src/styles/UserDashboard.css'; // Import the dashboard styles


const Dashboard = () => {
    return (
        <div className="dashboard-container">
            <header className="dashboard-header">
                <div className="profile-logo">
                    {/* Profile Image or Initial */}
                    P
                </div>
                <input
                    type="text"
                    className="search-bar"
                    placeholder="Search..."
                />
                <div className="message-icon">
                    {/* Message Icon */}
                    M
                </div>
            </header>

            <main className="dashboard-content">
                {/* Example Content */}
                <p>Welcome to the dashboard! Your posts and profiles will appear here.</p>
            </main>
        </div>
    );
};

export default Dashboard;
